const t="Welcome",e={en:"English",es:"Spanish",hn:"Hindi"},i="Home",n="Films",o="Audio Bibles",a="Resources",s="About",r="Map",c="Language",l="Title",u="Country",d="Date",m="Search",h="What is Anusaran?",b="<p>Anusaran is a literature mission, a non-profit Inter-Denominational Christian organization dedicated to bringing Evangelical Literature to the people of the Nation in variety and volume, publishing in many languages, establishing book centers and operating book mobiles. These are among various methods used to forward the programme.</p><p> Anusaran is primarily involved in starting and operating Christian bookstores, free online download, publishing enterprises and mobile book ministry in cities and towns where there is critical need.</p><p>Anusaran partners with the Churches and other Christian missions in order to meet the literature needs of new and maturing Christians. This task is accomplished by a dedicated team of committed staff.</p>",g=" ",p=" ",_={welcome:t,languages:e,"---- navigation ----":"",home:i,films:n,audio_bibles:o,resources:a,about:s,map:r,"---- fields ----":"",language:c,title:l,country:u,date:d,"---- utility ----":"",Search:m,"---- about page ----":"",about_ANU_title:h,about_ANU_description:b,about_BIBLICOS_title:g,about_BIBLICOS_description:p};export{m as Search,s as about,b as about_ANU_description,h as about_ANU_title,p as about_BIBLICOS_description,g as about_BIBLICOS_title,o as audio_bibles,u as country,d as date,_ as default,n as films,i as home,c as language,e as languages,r as map,a as resources,l as title,t as welcome};
